How to check the range between two timestamps is not overlaping two other timestamps<p>I'm using <strong>laravel</strong> with <strong>mongodb</strong> and I've got an overlapping issue when storing new data in database. I want to set this feature for user to store a new post in the database and also set a timer so the post get published at the requested timestamp and also be removed in a specific timestamp in the future. Everything is managed and tested but the only issue is overlapping.</p>
<p>The post data looks like this:</p>
<pre><code>    &quot;title&quot; : &quot;Some title&quot;,
    &quot;body&quot;  : [ dummy body data ... ],
    &quot;tags&quot;  : [ some tags here ...],
    &quot;publish_at&quot;   : &quot;1595740000&quot;, //timestamp
    &quot;unpublish_at&quot; : &quot;1595741111&quot;  //timestamp
</code></pre>
<p>And I'm storing the data in database:</p>
<pre><code> /**
 * Store a newly created resource in storage.
 *
 * @param StoreRequest $request
 * @return \Illuminate\Http\JsonResponse
 */
public function store(StoreRequest $request)
{
    $data = $request-&gt;validated();

    #Here I want to do the validation of timestamps
    #Using Post::all() I can access all of the posts in the database

    $count = Post::where('name', $data['name'])-&gt;count();
    if ($count !== 0) {
        // just a sample validation
        return 'name_already_exists';
    } else {
        Post::Create([
            &quot;title&quot; =&gt; $data['title'],
            &quot;body&quot; =&gt; $data['body'],
            &quot;tags&quot; =&gt; $data['tags'],
            &quot;is_active&quot; =&gt; true,
            &quot;publish_at&quot; =&gt; Carbon::parse($data['publish_at'])-&gt;timestamp,
            &quot;unpublish_at&quot; =&gt; Carbon::parse($data['unpublish_at'])-&gt;timestamp,
        ]);
        return &quot;resource created&quot;;
    }

}
</code></pre>
<p>Everything looks good! However, In case the user is adding different posts for being published and unpublished in the future, I need to check the new post timestamps not to overlap any other posts timestamps from database.</p>
<p>So far, I think I have to check 3 conditions here,</p>
<ol>
<li>the range between new post timestamps doesn't overlap any of others, <em><strong>The major problem</strong></em></li>
<li>the new post publish_at timestamp be bigger than now(), <em>which I know how to do it</em></li>
<li>the new post unpublish_at timestamp be bigger than publish_at timestamp, <em>which also I know how to do it</em></li>
</ol>
<p>The Laravel version is 6.18, the Mongodb ORM package is <a href="https://github.com/jenssegers/laravel-mongodb" rel="nofollow noreferrer">Jenssegers/Mongodb</a> which is pretty similar to eloquent ORM and the Carbon package is also installed.</p>
<p>Thank you so much.</p>

