AttributeError: 'NoneType' object has no attribute 'get'(MongoDB and Django)<p>We use MongoDB and Django in our project, some columns have <code>some_col</code> element, and some columns don't have <code>some_col</code> element, maybe that's why we will get the error of <code>AttributeError: 'NoneType' object has no attribute 'get'</code>, is there any solution to solve this errors?</p>
<pre><code>def get_col(self, name, **kwargs):
    where = {'name': name}
    if 'where' in kwargs and isinstance(kwargs['where'], dict):
        where.update(kwargs['where'])

    find_data = self.find_one(where)
    return find_data

def get_test_col(self):
    colmuns = Test(self.name)
    cls = colmuns.get_col('some_col')
    if not cls:
        self.some_col = {}
    self.some_col = cls.get('data', {}) # error line
</code></pre>

