MongoDB's aggregate $search is not pulling any results<p>So I am working on an express/mongoose/mongoDB app that requires users to query the database to find other users based upon 3 fields but for some reason, none of the documents I have made for testing purposes are being pulled as a result. Even when I am making the query parameter match identically to the fields being searched. The fields I am searching are:</p>
<ul>
<li>firstName</li>
<li>lastName</li>
<li>username</li>
</ul>
<p>I have the following model for my user (trimmed of course).</p>
<pre><code>const BlockedUser = require(&quot;./blockeduser&quot;);
const mongoose = require(&quot;mongoose&quot;);
const Schema = mongoose.Schema;
const UserSchema = new Schema({
  email: {
    type: String,
    required: [true, &quot;Please provide a valid email&quot;],
    unique: true,
    trim: true,
    lowercase: true
  },
  password: {
    type: String,
    minlength: 10,
    trim: true,
    select: false
  },
  username: {
    type: String,
    required: [true, &quot;Please provide a username&quot;],
    unique: true,
    minlength: 3,
    maxlength: 255
  },
  firstName: {
    type: String,
    required: [true, &quot;Please provide a first name&quot;],
    minlength: 3,
    maxlength: 255
  },
  lastName: {
    type: String,
    required: [true, &quot;Please provide a first name&quot;],
    minlength: 3,
    maxlength: 255
  },
  blockList: {// External collection of a list of blocked users
    type: Schema.Types.ObjectId,
    ref: 'BlockedUser'
  }
});

const User = mongoose.model(&quot;User&quot;, UserSchema);

module.exports = User;
</code></pre>
<p>And then the following query using mongoose in the express app.</p>
<pre><code>const mongoose = require(&quot;mongoose&quot;);
const User = require(&quot;../models/user&quot;);

router.get(&quot;/profiles&quot;, async (req, res, next) =&gt; {
  const users = await User.aggregate([
    {
      $search: {
        &quot;text&quot;: {
          &quot;query&quot;: req.query.q,
          &quot;path&quot;: [&quot;username&quot;, &quot;firstName&quot;, &quot;lastName&quot;],
          &quot;fuzzy&quot;: {}
        }
      }
    },
    {
      $match: {
        _id: {$ne: mongoose.Types.ObjectId(req.user.id)} // Makes sure the user is not pulling themselves as a result
      }
    },
    { // Populates blockList
      $lookup: {
        from: &quot;blockedusers&quot;,
        let: {
          &quot;theId&quot;: &quot;$blockList&quot;
        },
        pipeline: [
          {
            $match: {
              $expr: {
                $eq: [&quot;$_id&quot;, &quot;$$theId&quot;]
              }
            }
          }
        ],
        as: &quot;blockList&quot;
      }
    },
    {
      $match: {
        &quot;blockList.blockedUsers&quot;: {
          $ne: mongoose.Types.ObjectId(req.user.id) // Makes sure the user is not on the queried blocked user list
        }
      }
    },
    {
      $project: {
        _id: 0,
        email: 0
      }
    }
  ]);

  res.status(200).json({
    status: &quot;success&quot;,
    data: users
  });
});
</code></pre>
<p>And finally the query URL I am sending.</p>
<pre><code>http://127.0.0.1:1337/profiles?q=willow
</code></pre>
<p>And just to be thorough, here is the document I am trying to pull up.</p>
<pre><code>{
  username: &quot;Willow&quot;,
  firstName: &quot;Jennifer&quot;,
  lastName: &quot;Jones&quot;,
  email: &quot;email@example.com&quot;,
  password: &quot;examplepass1234&quot; // This is hashed don't worry :P
}
</code></pre>
<p>Did I miss something which is keeping my app from retrieving results? I also know the $text search is also available but I am currently testing and building on the free MongoDB tier and every time I try to use $text search I get the error saying that '$text is not available for this atlas tier'. Would love to get this figured out as this is one of the last steps to having a functional prototype haha!</p>
<p>Thank you to anyone who has some insight. It means a lot to me!</p>

