<p>Thank you to anyone who has some insight. It means a lot to me!</p>; Answer: instead of `.map((res: Response) => res.json())` do `.map((res: Response) => { result = res.json(); return result.map(r => new Radio(r.location, r.type);})` and in the `Radio` class add `constructor(private location, private type) {}` (you need to remove the `location` and `type` properties from the class because with `private xxx` in the constructor argument list they are already declared as class properties.

