Localhost not working in production in Docker<p>I successfully ran MERN app in my local machine using docker. Then, just for fun, I wanted it to deply to AWS, EC2 instance. After deploying, the fetch call in react-app gives this error:</p>
<pre><code>GET http://localhost:5000/posts/ net::ERR_CONNECTION_REFUSED
App.js:37 TypeError: Failed to fetch
</code></pre>
<p>I am just creating and getting posts from react app which gets saved in mongodb. This works well in the local machine but not in the Amazon EC2 instance(Ubuntu 18.04), it doesn't work even though the frontend part is still showing but gives error when there is a api call.</p>
<p>I sshed the instance and tried curl command inside it, it gave the correct result. But using public url provided, i.e, from react app, gives above error.</p>
<p>Here are some details and hope you guys can help me.</p>
<p>React: App.js</p>
<pre class="lang-js prettyprint-override"><code>import React from 'react';
import './App.css';

const serverUrl = 'http://localhost:5000'

const postModel = {
    title: '',
    body: '',
}

function App() {

    const [posts, setPosts] = React.useState([])
    const [post, setPost] = React.useState({ ...postModel })

    React.useEffect(() =&gt; {


        //get all the posts
        fetch(`${serverUrl}`, {
            method: 'GET',
        })
            .then(res =&gt; res.json())
            .then(res =&gt; {
                console.log(res)
            })
            .catch(err =&gt; console.log(err))

        //get all the posts
        fetch(`${serverUrl}/posts/`, {
            method: 'GET',
        })
            .then(res =&gt; res.json())
            .then(res =&gt; {
                setPosts([...res])
            })
            .catch(err =&gt; console.log(err))
    }, [])


    const _postChange = (e) =&gt; {
        setPost({ ...post, [e.target.name]: e.target.value })
    }

    const _addPost = () =&gt; {
        //add new post

        const requestJson = JSON.stringify(post)
        console.log(requestJson)
        fetch(`${serverUrl}/post/add/`, {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: requestJson
        })
            .then(res =&gt; res.json())
            .then(res =&gt; {
                console.log(res)
                setPosts([...posts, { title: res.post.title, body: res.post.body }]);
                setPost({ ...postModel })
            })
            .catch(err =&gt; console.log(err))
    }

    console.log(post)

    return (
        &lt;div className=&quot;App&quot;&gt;
            &lt;h2&gt;All Posts&lt;/h2&gt;
            &lt;div&gt;
                &lt;input placeholder=&quot;Post Title&quot; value={post.title} onChange={_postChange} type=&quot;text&quot; name=&quot;title&quot; /&gt;
                &lt;input placeholder=&quot;Post body&quot; value={post.body} onChange={_postChange} name=&quot;body&quot; /&gt;
                &lt;button onClick={_addPost}&gt;Add&lt;/button&gt;
            &lt;/div&gt;
            &lt;div&gt;
                {posts.map((instance, index) =&gt; {
                    return &lt;div key={index}&gt;
                        &lt;h4&gt;{instance.title}&lt;/h4&gt;
                        &lt;p&gt;{instance.body}&lt;/p&gt;
                        &lt;hr /&gt;
                    &lt;/div&gt;
                })}
            &lt;/div&gt;
        &lt;/div&gt;
    );
}

export default App;
</code></pre>
<p>React: Dockerfile</p>
<pre class="lang-sh prettyprint-override"><code># build environment
FROM node:12.2.0-alpine as build
WORKDIR /app
ENV PATH /app/node_modules/.bin:$PATH
COPY package.json /app/package.json
RUN npm install --silent
RUN npm install react-scripts@3.4.1 -g --silent
COPY . /app
RUN npm run build

# production environment
FROM nginx:1.16.0-alpine
COPY --from=build /app/build /usr/share/nginx/html
EXPOSE 80
CMD [&quot;nginx&quot;, &quot;-g&quot;, &quot;daemon off;&quot;]
</code></pre>
<p>React: package.json</p>
<pre><code>{
  &quot;name&quot;: &quot;react-app&quot;,
  &quot;version&quot;: &quot;0.1.0&quot;,
  &quot;private&quot;: true,
  &quot;dependencies&quot;: {
    &quot;cra-template&quot;: &quot;1.0.3&quot;,
    &quot;react&quot;: &quot;^16.13.1&quot;,
    &quot;react-dom&quot;: &quot;^16.13.1&quot;,
    &quot;react-scripts&quot;: &quot;3.4.1&quot;
  },
  &quot;scripts&quot;: {
    &quot;start&quot;: &quot;react-scripts start&quot;,
    &quot;build&quot;: &quot;react-scripts build&quot;,
    &quot;test&quot;: &quot;react-scripts test&quot;,
    &quot;eject&quot;: &quot;react-scripts eject&quot;
  },
  &quot;eslintConfig&quot;: {
    &quot;extends&quot;: &quot;react-app&quot;
  },
  &quot;browserslist&quot;: {
    &quot;production&quot;: [
      &quot;&gt;0.2%&quot;,
      &quot;not dead&quot;,
      &quot;not op_mini all&quot;
    ],
    &quot;development&quot;: [
      &quot;last 1 chrome version&quot;,
      &quot;last 1 firefox version&quot;,
      &quot;last 1 safari version&quot;
    ]
  }
}
</code></pre>
<p>backend: index.js</p>
<pre class="lang-js prettyprint-override"><code>const express = require('express');
